import React from 'react'
import Conditional from './conditional'



class Formz extends React.Component {
    constructor() {
        super()
        this.state = {
            isLoading: true
        }
    }
    componentDidMount() {
        setTimeout(() => {
            this.setState({
                isLoading: false
            })
        })
    }


    render() {
        return (<div>
            <Conditional isLoading={this.state.isLoading} />
        </div>
        )
    }
}

export default Formz
